import { Request, Response } from 'express';
import * as jwt from 'jsonwebtoken';
import { UserServices } from '../services';

const jwtConfig: jwt.SignOptions = {
    expiresIn: '999d',
    algorithm: 'HS256',
};

const secret = process.env.JWT_SECRET || 'jwt_secret';

export default class LoginController {
    public static login = async (req: Request, res: Response) => {
        try {
            const { name } = req.body;
            const user = await UserServices.findByName(name);
            const token = jwt.sign({ ...user }, secret, jwtConfig);
            if (user.role === 'admin') {
                return res.status(200).json({ token });
            }
            return res.status(200).json({ message: `User ${name} logged in` });
        } catch (err: any) {
            return res.status(500).json({
                message: 500,
                error: err.message,
            });
        }
    };
}

import { Request, Response } from 'express';
import * as bcrypt from 'bcryptjs';
import { UserServices } from '../services';

export default class UserController {
    public static addNewUser = async (req: Request, res: Response) => {
        try {
            const { body } = req;

            const salt = bcrypt.genSaltSync(10);

            const hash = bcrypt.hashSync(body.password, salt);

            const newUser = {
                name: body.name,
                role: body.role,
                password: hash,
            };

            await UserServices.addNewUser(newUser);

            return res.status(201).json({ message: `User ${body.name} successfully created` });
        } catch (err: any) {
            return res.status(500).json({
                message: 500,
                error: err.message,
            });
        }
    };
}

import { validate } from 'cpf-check';
import { NextFunction, Request, Response } from 'express';
import { CPFServices } from '../services';
import { CPFresponse } from '../types/types';

export default class CPFValidate {
    public static CPFBodyFormatValidate = async (req: Request, res: Response, next: NextFunction) => {
        try {
            const { cpf } = req.body;
            const CPFFormatCheck = validate(cpf);
            if (!CPFFormatCheck) {
                return res.status(400).json({ message: 'InvalidCpfException' });
            }
            return next();
        } catch (error) {
            return res.status(500).json(error.message);
        }
    };
    public static CPFParamsFormatValidate = async (req: Request, res: Response, next: NextFunction) => {
        try {
            const { cpf } = req.params;
            const CPFFormatCheck = validate(cpf);
            if (!CPFFormatCheck) {
                return res.status(400).json({ message: 'InvalidCpfException' });
            }
            return next();
        } catch (error) {
            return res.status(500).json(error.message);
        }
    };

    public static checkIfCPFExist = async (req: Request, res: Response, next: NextFunction) => {
        try {
            const params = req.params;
            const CPFresult: CPFresponse | null = await CPFServices.findOneCPF(params.cpf);

            if (CPFresult === null) return res.status(404).json({ message: 'NotFoundCpfException' });

            return next();
        } catch (error) {
            return res.status(500).json(error.message);
        }
    };

    public static checkIfCPFAlreadyExist = async (req: Request, res: Response, next: NextFunction) => {
        const { cpf } = req.body;
        const CPFcheck = await CPFServices.findOneCPF(cpf);
        if (CPFcheck) {
            return res.status(409).json({ message: 'ExistsCpfException' });
        }
        return next();
    };
}

import { NextFunction, Request, Response } from 'express';
import * as jwt from 'jsonwebtoken';

require('dotenv/config');

const secret = process.env.JWT_SECRET || 'jwt_secret';

class AuthMiddleware {
    public static tokenHandle(req: Request, res: Response, next: NextFunction) {
        try {
            const token = req.header('Authorization');
            if (!token) {
                return res.status(401).json({ message: 'Token not found' });
            }
            jwt.verify(token, secret as jwt.Secret, (err, user) => {
                if (err) return res.status(401).json({ message: 'Token must be a valid token' });
                req.body = { ...req.body, user };
                return next();
            });
        } catch (err) {
            return res.status(401).json({ message: 'Expired or invalid token' });
        }
    }
}

export default AuthMiddleware;

import express from 'express';
import { UserController } from '../controllers';
import UserValidate from '../middleware/user.validate';
import AuthMiddleware from '../auth/auth';

const router = express.Router();

router.post('/', AuthMiddleware.tokenHandle, UserValidate.createUserfieldHandle, UserController.addNewUser);

export default router;

import { NextFunction, Request, Response } from 'express';
import * as bcrypt from 'bcryptjs';
import { UserServices } from '../services';

const incorrectMsg = 'Incorrect name or password';

class UserValidate {
    public static createUserfieldHandle = async (req: Request, res: Response, next: NextFunction) => {
        try {
            const { name, password, role } = req.body;
            const fieldsRequire = name && password && role;

            if (!fieldsRequire) {
                return res.status(400).json({ message: 'All fields must be filled' });
            }
            const findUser = await UserServices.findByName(name);
            if (findUser !== null) {
                return res.status(409).json({ message: 'UserAlreadyExist' });
            }

            return next();
        } catch (err: any) {
            return res.status(400).json({ message: err.message });
        }
    };

    public static loginFieldHandle = async (req: Request, res: Response, next: NextFunction) => {
        try {
            const { name, password } = req.body;
            const fieldsRequire = name && password;

            if (!fieldsRequire) {
                return res.status(400).json({ message: 'All fields must be filled' });
            }
            return next();
        } catch (err: any) {
            return res.status(400).json({ message: err.message });
        }
    };

    public static fieldValidate = async (req: Request, res: Response, next: NextFunction) => {
        try {
            const { name, password } = req.body;
            const userData = await UserServices.findByName(name);
            if (!userData) {
                return res.status(401).json({ message: incorrectMsg });
            }

            const checkPassword = bcrypt.compareSync(password, userData.password);

            if (checkPassword === false) {
                return res.status(401).json({ message: incorrectMsg });
            }

            return next();
        } catch (err: any) {
            return res.status(400).json({ message: err.message });
        }
    };
}
export default UserValidate;

import express from 'express';
import { LoginController } from '../controllers';
import UserValidate from '../middleware/user.validate';

const router = express.Router();

router.post('/', UserValidate.loginFieldHandle, UserValidate.fieldValidate, LoginController.login);

export default router;
